        "productName": "Pillow Talk Palette of Pops Luxury Eyeshadow Quad",
        "descriptionLong": "What it is: An eyeshadow palette in a sheer nude-pink color harmony inspired by Charlotte Tilbury's best-selling shade Pillow Talk.What it does: The best-selling, globally loved, nude-pink eye palette now features mesmerizing sparkle for bejeweled eyes that dazzle, delight and hypnotize. Each hue contains multi-reflecting pearls which give your eyes a molten, sparkly finish, while glossy ester provides color intensity and brightness to boost each shade's vibrancy. Mica gives the pigments a soft, gliding effect for easy application and a silky-smooth finish.How to use: For a daytime look, begin by applying the pearly pink Prime shade to the entire eyelid. You can also apply the Prime shade to the inner corners of your eyes to help brighten them. Wash the soft pink Enhance shade over your eyelids and into the crease of your eye. Also apply Enhance along the upper and lower lashlines. For a glamorous finish, blend the red-bronze Smoke shade from the outer corner of the eye upward into the crease. Blend in and apply across the upper and lower lashline. Apply the peachy-bronze Pop to the center of your eyelid using your ring finger. Style Name:Charlotte Tilbury Pillow Talk Palette Of Pops Luxury Eyeshadow Quad. Style Number: 5993277. Available in stores.",
