        "productName": "Matte Lipstick",
        "descriptionLong": "What it is: A lipstick with an intense, velvety matte finish that offers instant color vibrancy and conditions lips for radically lightweight wear. What it does: This lipstick is formulated with a dynamic blend of moringa and passionfruit seed oils to enhance color vibrancy and condition lips for radically lightweight wear and an unprecedented feel. Its long-lasting color is resistant to bleed and feathering, while enhanced pigment dispersion provides an even and pure color application.How to use: Apply the lipstick directly from the bullet or with a lip brush. For precise definition and longer wear, line your lips starting in the outer corners and working inward. Apply the lipstick all over, blending color with a brush or your fingertips. Use a concealer to clean up the edges or a brighter shade of concealer on the cupid's bow to make color pop. Style Name:Nars Matte Lipstick. Style Number: 5888210. Available in stores.",
